import { createStore } from 'vuex';
import listPSCP from './modules/listPSCP';
import listPs from './modules/listPs';
import myCalendar from './modules/myCalendar';

const store = createStore({
  modules: {
    listPSCP,
    listPs,
    myCalendar,
  },
});

export default store;
